A hip new restaurant updates French bistro classics; the famous provencal dish bouillabaisse;
            hearty French countryside dishes; Chef Marc Murphy pays homage to the foods he grew up eating in France and
            Italy.

Television enters the Platinum Age in the 2000s, as storytellers take the medium to new heights;
            the creative renaissance in television enjoys groundbreaking shows such as "The Sopranos," "Mad Men,"
            "Breaking Bad," "Lost" and "Survivor."

Option traders discuss how to increase profits and limit losses using common option techniques;
            the panel demystifies the daunting terminology used when talking about options, and it simplifies this
            fast-growing and crucial corner of the market.

